import React, { useEffect } from "react";

import "./styles.css"

import TagCloud from "TagCloud";

const TextSphere = () => {
    useEffect(() => {
        return () => {
            const container = ".tagcloud";
            const texts = [
                "HTML",
                "CSS",
                "SASS",
                "JavaScript",
                "React",
                "Vue",
                "Tilda",
                "Bitrix",
                "PHP"
            ]
        }
    })
}
